import React, { Component } from 'react';
import '../../SCSS/nav.scss'
import ngeLogo from '../Images/nge.png'
class nav extends Component {

    constructor(props){
        super(props)
        this.state = {
            imageFile: "",
            username: "",
        }
        this.imageFile = ""
        this.username =  ""

    }

     componentDidUpdate(){
        this.imageFile = this.props.imageFile[0]
        this.username = this.props.username[0]
       }





    render() {

        return (
            <div id="navContainer">
                <img src={this.imageFile} id="ngeLogo" />
                {this.username}
            </div>
        );
    }
}

export default nav;
